import styled, {css} from 'styled-components';


export const ModalLayer = styled.div`
    width: 100px;
    height: 100px;
    display: ${props.layerDisplay};
    position: absolute;
    background-color: gray;
    top: 30px;
    left: 50%;
    transform: translateX(-50%);
`
